INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (2, 1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 321, 0, 1, 24001, "リリ", 40011, 125801);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (2, 2, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, 322, 0, 1, 24001, "クリア", 40011, 126001);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (2, 3, "んーと。\nこれ、あげる。\nはい", 1, 323, 0, 1, 24001, "プレシア", 40011, 126101);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (2, 4, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 1, 324, 0, 2, 24001, "リリ", 40011, 125801);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (2, 5, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 1, 325, 0, 2, 24001, "クリア", 40011, 126001);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (2, 6, "お兄。\nきてくれて、うれしい", 1, 326, 0, 2, 24001, "プレシア", 40011, 126101);
